SET FOREIGN_KEY_CHECKS = 0;
SET SQL_SAFE_UPDATES = 0;

































































































ALTER TABLE researchers
ADD age VARCHAR(40);

UPDATE researchers SET age = CONCAT
(
FLOOR((TIMESTAMPDIFF(MONTH, birth_date, CURDATE()) / 12)), ' YEARS ',
MOD(TIMESTAMPDIFF(MONTH, birth_date, CURDATE()), 12) , ' MONTHS'
);

ALTER TABLE projects
ADD duration INT UNSIGNED;

UPDATE projects SET duration = TIMESTAMPDIFF(YEAR,project_starting_date,project_due_date);

DROP VIEW IF EXISTS view_projects_researcher;

CREATE VIEW view_projects_researcher AS 
SELECT researchers.first_name,
	researchers.last_name,
    projects.project_title
FROM (researchers JOIN works ON works.researcher_ID = researchers.researcher_ID)
JOIN projects ON works.project_ID = projects.project_ID 
ORDER BY researchers.last_name, researchers.first_name;

DROP VIEW IF EXISTS view_projects_sf;

CREATE VIEW view_projects_sf AS 
SELECT belongs_to.scientific_field,
    projects.project_title
FROM projects JOIN belongs_to ON belongs_to.project_ID = projects.project_ID 
ORDER BY projects.project_title;



